n empty list and !EXISTS are not really the same)\n  local paused\n  if rcall(\"EXISTS\", KEYS[3]) ~= 1 then\n    target = KEYS[1]\n    paused = false\n  else\n    target = KEYS[2]\n    paused = true\n  end\n\n  -- Standard or priority add\n  local priority = tonumber(ARGV[9])\n  if priority == 0 then\n      -- LIFO or FIFO\n    rcall(ARGV[10], target, jobId)\n  else\n    -- Priority add\n    rcall(\"ZADD\", KEYS[6], priority, jobId)\n    local count = rcall(\"ZCOUNT\", KEYS[6], 0, priority)\n\n    local len = rcall(\"LLEN\", target)\n    local id = rcall(\"LINDEX\", target, len - (count-1))\n    if id then\n      rcall(\"LINSERT\", target, \"BEFORE\", id, jobId)\n    else\n      rcall(\"RPUSH\", target, jobId)\n    end\n\n  end\n\n  -- Emit waiting event (wait..ing@token)\n  rcall(\"PUBLISH\", KEYS[1] .. \"ing@\" .. ARGV[11], jobId)\nend\n\nreturn jobId .. \"\" -- convert to string\n\r\n$1\r\n6\r\n$24\r\nbull:aggregateCheck:wait\r\n$26\r\nbull:aggregateCheck:paused\r\n$31\r\nbull:aggregateCheck:meta-paused\r\n$22\r\nbull:aggregateCheck:id\r\n$27\r\nbull:aggregateCheck:delayed\r\n$28\r\nbull:aggregateCheck:priority\r\n$20\r\nbull:aggregateCheck:\r\n$53\r\nrepeat:28fd7774e67114260dcae19e013157dd:1716834600000\r\n$11\r\n__default__\r\n$2\r\n{}\r\n$221\r\n{\"repeat\":{\"count\":1,\"key\":\"__default__::::0 0 * * *\",\"cron\":\"0 0 * * *\"},\"jobId\":\"repeat:28fd7774e67114260dcae19e013157dd:1716834600000\",\"delay\":21399598,\"timestamp\":1716813200402,\"prevMillis\":1716834600000,\"attempts\":1}\r\n$13\r\n1716813200402\r\n$8\r\n21399598\r\n$13\r\n1716834600000\r\n$1\r\n0\r\n$5\r\nLPUSH\r\n$36\r\ncad9048b-e491-4762-b049-3cea82d8578d\r\n"
